window.bookSummaryJSON = "<p>Allies and enemies are not always what they seem.</p> <p>Trapped on a hostile world, hunted by pirate bands, and abandoned by her fellow captains, Alexis Carew must lead her small band to safety, even though it seems every hand is set against her. Stalked by pirates in the skies above and shadowy alien figures on the planet below, Alexis must convince former enemies to trust her even as she discovers where the tendrils of her true enemies lead.</p>"; 
